import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const AppList = () => {
  return (
    <h1> Hello</h1>
  );
}

const el = (<>
<h1> Helvetica </h1>
<AppList></AppList>
</>);

ReactDOM.render(
  el,
  document.getElementById('root')
);
